def clamp(n, minn, maxn):
    return max(min(maxn, n), minn)

class Keyboard:
    def __init__(self):
        self._pos = [1, 1]

    @property
    def digit(self):
        return 3 * self._pos[0] + self._pos[1] + 1

    def move(self, d):
        changes = dict(
            R=(0, 1),
            L=(0, -1),
            U=(-1, 0),
            D=(1, 0)
        )
        delta = changes[d]
        self._pos[0] = clamp(self._pos[0] + delta[0], 0, 2)
        self._pos[1] = clamp(self._pos[1] + delta[1], 0, 2)

txt = """





"""

kb = Keyboard()
for line in filter(None, txt.split('\n')):
    for d in line:
        kb.move(d)
    print(kb.digit)
